import React from 'react';
import './signup.css';
import chefImage from '../images/logo.jpg';
import bottomDecoration from './bottom-decoration.png'; 

const SignIn = () => {
    return (
        <div className="container">
            <div className="top-graphic">
                <img src={chefImage} alt="Chef Graphic" />
            </div>
            <div className="form-container">
                <h2>Sign In</h2>
                <p>Already have an account? <a href="#">Log In</a></p>
                <form>
                    <input type="text" placeholder="First Name" />
                    <input type="text" placeholder="Last Name" />
                    <input type="email" placeholder="Email" />
                    <input type="password" placeholder="Password" />
                    <p className="error">Please input the correct password</p>
                    <button type="submit">Create Account</button>
                </form>
            </div>
            <div className="bottom-graphic">
                <img src={bottomDecoration} alt="Decoration" />
            </div>
        </div>
    );
};

export default SignIn;
